import { Constant } from "../constants/AppConstants";

const initialState = {
  userId: null
};

export function rootReducer(state = initialState, action) {
  switch(action.type) {
    case SET_USERID :
      state.userId = action.payload.userId;
      return state;
    default :
      return state;
  }
};
